import React from 'react';

import './styles.css';

import ToDoCard from './ToDoCard';

const ToDoList = ({title, cards }) => {
    return (
        <div className="to-do-list-container">
            <h4>{title}</h4>
            { cards.map(card => <ToDoCard text={card.text}/>)}
        </div>
    );
}

export default ToDoList;
